import React from 'react';
import {Form, Button, Col, fieldset, Row} from 'react-bootstrap';
import CustomButton from './components/Menu';

function Header() {
	return(
		<div>
		    <CustomButton
		      href="https://github.com/styled-components/styled-components"
		      target="_blank"
		      rel="noopener"
		      primary
		    >
		      GitHub
		    </CustomButton>
		    <CustomButton as={Link} href="/docs">
		      Documentation
		    </CustomButton>
		</div>
	);
}

export default Header;
